// 2976. Minimum Cost to Convert String I
// https://leetcode.com/problems/minimum-cost-to-convert-string-i/description/
// Dijkstra's Algorithm
// T.C.: O(n)
// S.C.: O(1)
/**
 * @param {string} source
 * @param {string} target
 * @param {character[]} original
 * @param {character[]} changed
 * @param {number[]} cost
 * @return {number}
 */
var minimumCost = function (source, target, original, changed, cost) {
  const a = 'a'.charCodeAt();
  const graph = Array.from({ length: 26 }, () => new Array(26).fill(Infinity));
  const n = original.length;
  for (let i = 0; i < n; i++) {
    const originalIndex = original[i].charCodeAt() - a;
    const changedIndex = changed[i].charCodeAt() - a;
    const changedCost = cost[i];
    graph[originalIndex][changedIndex] = Math.min(graph[originalIndex][changedIndex], changedCost);
  }

  let result = 0;
  const memo = Array.from({ length: 26 }, () => new Array(26).fill(-1));
  for (let i = 0; i < source.length; i++) {
    if (source[i] === target[i]) continue;
    const sourceNode = source[i].charCodeAt() - a;
    const targetNode = target[i].charCodeAt() - a;
    if (memo[sourceNode][targetNode] === -1) {
      const changedCost = dijkstra(source[i].charCodeAt() - a, target[i].charCodeAt() - a);
      memo[sourceNode][targetNode] = changedCost;
    }
    result += memo[sourceNode][targetNode];
  }
  return result === Infinity ? -1 : result;

  function dijkstra(sourceNode, targetNode) {
    const visited = new Set();
    const distances = new Array(26).fill(Infinity);
    distances[sourceNode] = 0;

    const queue = new MinHeap([[0, sourceNode]], (a, b) => a[0] - b[0]);
    while (queue.length) {
      const [costToCurrentNode, currentNode] = queue.pop();
      if (currentNode === targetNode) return costToCurrentNode;
      if (visited.has(currentNode)) continue;
      visited.add(currentNode);

      for (let neighborNode = 0; neighborNode < 26; neighborNode++) {
        const neighborCost = graph[currentNode][neighborNode];
        if (neighborCost === Infinity || visited.has(neighborNode)) continue;
        queue.push([costToCurrentNode + neighborCost, neighborNode]);
      }
    }
    return Infinity;
  }
};

class MinHeap {
  constructor(data = [], compare = (a, b) => a - b) {
    this.data = data;
    this.length = this.data.length;
    this.compare = compare;

    if (this.length > 0) {
      for (let i = (this.length >> 1) - 1; i >= 0; i--) this._down(i);
    }
  }

  push(item) {
    this.data.push(item);
    this.length++;
    this._up(this.length - 1);
  }

  pop() {
    if (this.length === 0) return undefined;

    const top = this.data[0];
    const bottom = this.data.pop();
    this.length--;

    if (this.length > 0) {
      this.data[0] = bottom;
      this._down(0);
    }

    return top;
  }

  peek() {
    return this.data[0];
  }

  _up(pos) {
    const { data, compare } = this;
    const item = data[pos];

    while (pos > 0) {
      const parent = (pos - 1) >> 1;
      const current = data[parent];
      if (compare(item, current) >= 0) break;
      data[pos] = current;
      pos = parent;
    }

    data[pos] = item;
  }

  _down(pos) {
    const { data, compare } = this;
    const halfLength = this.length >> 1;
    const item = data[pos];

    while (pos < halfLength) {
      let left = (pos << 1) + 1;
      let best = data[left];
      const right = left + 1;

      if (right < this.length && compare(data[right], best) < 0) {
        left = right;
        best = data[right];
      }
      if (compare(best, item) >= 0) break;

      data[pos] = best;
      pos = left;
    }

    data[pos] = item;
  }
}

var source = 'abcd',
  target = 'acbe',
  original = ['a', 'b', 'c', 'c', 'e', 'd'],
  changed = ['b', 'c', 'b', 'e', 'b', 'e'],
  cost = [2, 5, 5, 1, 2, 20];
var expected = 28;
var result = minimumCost(source, target, original, changed, cost);
console.log(result, result === expected);

